const initState = {
  channels: [
    { id: "1", title: "hello", description: "i am saying hi" },
    { id: "1", title: "bye", description: "i am saying bye" },
    { id: "1", title: "kbfjg", description: "i am saying fjmkfdmkd" },
  ],
};

const channelReducer = (state = initState, action) => {
  return state;
};

export default channelReducer;
